We are committed to protecting and respecting your privacy.
This privacy policy sets out the basis on which any information (which may include personal data) we collect from you, or that you provide to us, through the Site* will be processed by us. Please read the following carefully to understand our practices regarding your information and how we will treat it.
By visiting this website (the Site) you are accepting and consenting to the practices described in this policy (including as updated or amended from time to time). If, for any reason, you do not agree to the terms of this policy, please stop using the Site immediately.
*Please note that the Queen official store (the Store) although accessible via the Site is operated by a third party, Universal Music Direct Limited (trading as Digital Stores), and information provided by you in the course of using the Store is controlled and processed by Digital Stores and not us. However by submitting information to Digital Stores you are agreeing that such information can be shared with us, and this privacy policy shall also apply to information so shared.
Who we are
The Site (other than the Store) is operated by Queen Productions Limited, company registration no. 01226628, whose business address is 4 Gee’s Court, St Christopher’s Place, London W1U 1JD. The email address for any correspondence regarding the use of your personal data is: [email protected]
Information we may collect from you
When you use the Site or contact us by e-mail, social media, SMS, telephone, or other methods, we may collect and process the following data about you:
Information you give us, including:


Forms filled out by you on the Site;
Content of correspondence with us by phone, e-mail or otherwise;
Site registration;
Subscriptions or orders placed on the Site;
Participation in discussion boards or other social media functions on the Site;
Entering a competition, promotion or survey;
Reporting a problem or requesting support for the Site.

The information you give us may include your name, address, e-mail address and phone number, date of birth, payment information, personal description, photographs or images or comments.
Information we collect about you
With regard to each of your visits to the Site we may automatically collect the following information:

Technical information, including IP address, login information, browser type and version, time zone setting, browser plug-in types and versions, operating system and platform;
Information about your visit, including the full URL clickstream to, through and from the Site (including date and time);
Pages you viewed or searched for; page response times, download errors, length of visits to certain pages, page interaction information (such as scrolling, clicks, and mouse-overs), and methods used to browse away from the page.

Information we collect from other sources
In addition to the information we receive from Digital Stores, we may receive information about you if you use any of the other websites operated by any of the companies in the Universal Music Group (which include Universal Music Direct Limited, 364-366 Kensington High Street, London W14 8NS. Data Protection Number Z788930X) (UMG).
We are also working closely with third parties (including, for example, business partners, sub-contractors in technical, payment and delivery services, advertising networks, analytics providers, social networks such as Facebook and Twitter, search information providers, credit reference agencies, third parties who enable sign on functionality and social network integration) and may receive information about you from them.
If you choose to use features on the Site or on any UMG websites that connect to your online profiles or social media accounts (Connected Accounts), we may collect any information that you permit through your settings on those Connected Accounts. For example, if you log in to the Site using your Facebook account and choose to allow Facebook to share your profile with us, we may collect that information. Information we receive from Connected Accounts with your consent may include email address, first and last name, location (hometown and country), gender, date of birth, likes, posts or other social activity. Please review your Connected Account privacy settings to control what information is provided to us through this option.
How your information may be used
We may use information held about you in the following ways:
Information you give to us or through Connected Accounts
We will use this information:

To help us respond to your queries;
To provide you with information about Queen;
To carry out our obligations arising from any contracts entered into between you and us and to provide you with the information, products and services that you request from us;
To provide you with information about other goods and services we offer that are similar to those that you have already purchased or enquired about;
To provide you, or permit selected third parties to provide you, with information about goods or services we feel may interest you;
To notify you about changes to our service;
To manage your access to the services;
To allow you to interact with the Site, for example by posting comments;
To allow you to share information from the Site on third party social media platforms;
To comply with legal and regulatory requirements.

Information we collect about you
We will use this information:

To administer the Site and for internal operations, including troubleshooting, data analysis, testing, research, statistical and survey purposes;
To improve the Site to ensure that content is presented in the most effective manner for you and for your computer;
To allow you to participate in interactive features of our service, when you choose to do so;
As part of our efforts to keep the Site safe and secure;
To measure or understand the effectiveness of advertising we serve to you and others, and to deliver relevant advertising to you;
To make suggestions and recommendations to you and other users of the Site about goods or services that may interest you or them, if we have received your consent to do so;
To provide or permit third parties to provide targeted advertising via websites you visit about goods or services that you may find interesting (see more on this in our Cookies Policy;
To track the progress and number of entries in competitions and promotions.

Information we receive from other sources
We may combine information we receive from other sources with information you give to us and information we collect about you. We may use this combined information for the purposes set out above;
Disclosure of your information
We may share your personal information with any UMG company that manages any of the Queen properties, and with selected third parties including:
Business partners, suppliers and sub-contractors for the performance of any contract we enter into with them or you in order to provide you with a product or service;
Business partners, suppliers and sub-contractors to provide you with information about promotions and offers;
Aggregated, anonymized or other data to advertisers, advertising networks and social networks that require the data to select and serve relevant adverts to you and others. We may also use aggregate information to help advertisers reach the kind of audience they want to target. We may make use of the personal data we have collected from you to enable us to comply with our advertisers' wishes by displaying their advertisement to that target audience;
We may from time to time choose to work with a number of carefully selected third party companies (including Comufy, Facebook, Twitter, Videology) that provide a broad range of online solutions, from traffic analysis and advertising to user experience enhancements, such as enabling you to use the same login details across multiple websites. It is sometimes necessary to provide these companies with access to limited personal information about our users. In such cases we will share only the personal data required to for these companies to perform their functions and will not allow them to use this data for any other purposes;
Analytics and search engine providers that assist us in the improvement and optimisation of the Site.
We may disclose your personal information to third parties:


In the event that we sell or buy any business or assets, in which case we may disclose your personal data to the prospective seller or buyer of such business or assets;
If Queen Productions Limited or substantially all of its assets are acquired by a third party, in which case personal data held by it about its customers will be one of the transferred assets;
If we are under a duty to disclose or share your personal data in order to comply with any legal obligation, or in order to enforce or apply our terms of use and other agreements; or to protect the rights, property, or safety of Queen Productions Limited, its artists, our customers, or others. This includes exchanging information with other companies and organisations for the purposes of fraud protection and credit risk reduction;
To any other third party with your prior consent to do so.

Storage and transfer of data
All the information you provide may be processed and stored, transferred or accessed by entities around the world as described in this policy. By submitting your information and using the Site, you agree to this transfer, storing or processing. We will take all steps reasonably necessary to ensure that your data is treated securely and in accordance with this privacy policy. We have put in place appropriate technical and organisational procedure to safeguard the information we collected on the Site.
The security of your personal information is important to us. All information you provide to us is stored on our secure servers or secure services controlled by third parties on our behalf. Any payment transactions will be encrypted using SSL technology. Where we have given you (or where you have chosen) a password which enables you to access certain parts of the Site, you are responsible for keeping this password confidential. We ask you not to share a password with anyone.
Unfortunately, the transmission of information via the internet is not completely secure. Although we will do our best to protect your personal data, we cannot guarantee the security of your data transmitted to the Site; any transmission is at your own risk. Once we have received your information, we will use strict procedures and security features to try to prevent unauthorised access.
Cookies
The Site uses cookies to distinguish you from other users of the Site. This helps us to provide you with a good experience when you browse the Site and also allows us to improve the Site. For detailed information on the cookies and other technologies we use and the purposes for which we use them see our Cookies Policy.
Social Media
The Site includes Social Media Features, such as the Facebook Like button. These Features may collect your IP address, which page you are visiting on the Site, and may set a cookie to enable the Feature to function properly. Social Media Features and Widgets are either hosted by a third party or hosted directly on the Site. Your interactions with these Features are governed by the privacy policy of the company providing it.
You can log in to the Site using sign-in services such as Facebook Connect or an Open ID provider. These services will authenticate your identity and provide you the option to share certain personal information with us such as your name and email address to pre-populate our sign up form. Services like Facebook Connect give you the option to post information about your activities on the Site to your profile page to share with others within your network.
Children
The Site is not directed toward children under 13 years of age nor do we knowingly collect information from children under 13 without parental consent and in compliance with applicable laws.
Your Rights
Where applicable under local law, you may request a copy of the personal information held by us about you and may ask about all recipients of the information, the purpose of the processing, request the correction of incorrect data, and request the blocking and deletion of such data by contacting us as described in the Contact section below. We may require you to prove your identity with approved identification if you request this information.
You are responsible for keeping your information current and up-to-date. You may update your information by contacting us as described in the Contact section below. You also have the right, where provided under applicable law, to ask us not to process your personal data
If your personal information changes, or if you no longer desire our service, you may correct, update, amend, delete or remove it by contacting us as described in the Contact section below. We will respond to your request to access within 30 days.
We will retain your information for as long as your account is active or as needed to provide you services. We will retain and use your information as necessary to comply with our legal obligations, resolve disputes, and enforce our agreements.
If you wish to subscribe to our newsletter(s), we will use your name and email address to send the newsletter to you. Out of respect for your privacy, you may choose to stop receiving our newsletter or marketing emails by following the unsubscribe instructions included in these emails, accessing the email preferences in your account settings page or you can contact us as described in the Contact section below.
Where provided under applicable law, you may have the right to ask us for a list of your personal data we share with third parties and information regarding those third parties, if the third parties use the personal data for their direct marketing purposes. We will seek your consent (before collecting your data) if we intend to use your data for such purposes or if we intend to disclose your information to any third party for marketing purposes. You can exercise your right to prevent such processing by checking certain boxes on the forms we use to collect your data. You can also exercise the right at any time by contacting us as described in the Contact section below.
Links to third party websites
The Site, our newsletters and other communications may, from time to time, contain links to and from the websites of our partner networks, advertisers and affiliates. If you follow a link to any of these websites, please note that these websites have their own privacy policies and that we do not accept any responsibility or liability for these policies.
Changes to this privacy policy
Any material changes we may make to our privacy policy in the future will be posted on this page prior to the change becoming effective and/or we will notify you through the Site or, where appropriate, by e-mail. Please check back frequently to see any updates or changes to our privacy policy. These changes will become effective upon obtaining your consent, if necessary, as required under local law. If you do not agree or consent to these updates or changes, do not continue to use the Site.
Contact
Questions, comments and requests regarding this privacy policy should be sent to: [email protected]
